@oprah at @atdnational conference: “Your purpose is to do what you have to do until you can do what you want to do.” 

She’s speaking about those who feel they should be able to do fulfilling work out of the gate. 

It is a journey, for sure. #leadership #ADT2019

The odds of reaching our destination are much better when we work together.
@morethanmove 

